import React from 'react';
import {Nav} from 'react-bootstrap';
import newspaper from './newspaper.svg';
import user from './user.svg';
import shoppingcart from './shoppingcart.svg';
import './Navigation.css';

const Navigation = () => 
{
    return(
        <Nav className="Nav">
            <Nav.Item>
                <Nav.Link href="/home"><img className="home" src={newspaper}/></Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link className="profile" href="/profile"><img src={user}/></Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link className="purchase" href="/purchase"><img src={shoppingcart}/></Nav.Link>
            </Nav.Item>
        </Nav>
    )
}

export default Navigation;
